const PtSansRegular = `@font-face { font-family: 'PT Sans'; font-style: normal; font-weight: 400; src: local('PT Sans'), local('PTSans-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const PtSansItalic = `@font-face { font-family: 'PT Sans'; font-style: italic; font-weight: 400; src: local('PT Sans Italic'), local('PTSans-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const PtSans700 = `@font-face { font-family: 'PT Sans'; font-style: normal; font-weight: 700; src: local('PT Sans Bold'), local('PTSans-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const PtSans700italic = `@font-face { font-family: 'PT Sans'; font-style: italic; font-weight: 700; src: local('PT Sans Bold Italic'), local('PTSans-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
